- input: "TEXT\x1CC00010439\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission's request for additional information dated May 29, 2013, as follows:
    \ 1.  The absentee ballot postcard for which the Idaho Democratic party paid printing,
    supplies and postage did not refer to any Federal, state or local candidate.  The
    absentee ballot chase calls did not mention any Federal, state or local candidate,
    but asked only when the absentee ballot would be returned.  2.  The Idaho Democratic
    party is aware of the limitations on the use of monies received from the National
    Democratic Party and from other state or local parties.  The Idaho Democratic
    Party maintains an accounting system for the sources and uses of its funds to
    assure that the Federal component of Line 30(a) Federal Election Activity is paid
    for with other sources of funds, and that no funds transferred from the DNC or
    other party committees is used for the Federal portion of Line 30(a) funds.    This
    amendment also corrects a deposit of $410 on 9/17/2012 for individual contributions
    through the ActBlue IDP Federal account that were incorrectly reported in the
    state account and the funds reported as a transfer from the State to the Federal
    account. The contributions have now been itemized on this report and the transfer
    reduced by that amount.   All employee salaries, benefits, payroll taxes, insurance,
    and reimbursed expenses for employees who spend >25% of the month on Federal election
    activities are paid entirely with Federal funds and the expenses are reported
    on Line 30(b).  All other employee costs are shared Federal/Non Federal activities.\n"
